var input = "";
//input = "dabAcCaCBAcCcaDA";

var alphabet = {
  A: 0,
  B: 0,
  C: 0,
  D: 0,
  E: 0,
  F: 0,
  G: 0,
  H: 0,
  I: 0,
  J: 0,
  K: 0,
  L: 0,
  M: 0,
  N: 0,
  O: 0,
  P: 0,
  Q: 0,
  R: 0,
  S: 0,
  T: 0,
  U: 0,
  V: 0,
  W: 0,
  X: 0,
  Y: 0,
  Z: 0
}

function findReaction(letters) {
  for (var i = 0; i < letters.length - 1; i++) {
    var letter = letters[i];
    var letterOtherCase = letter === letter.toUpperCase() ? letter.toLowerCase() : letter.toUpperCase();
    if (letters[i+1] === letterOtherCase) {
      return i;
    }
  }
  return -1;
}

Object.keys(alphabet).forEach((alphabetLetter) => {
  var exit = false;
  var regex = new RegExp(`${alphabetLetter}|${alphabetLetter.toLowerCase()}`, "g");
  var modifiableInput = input.replace(regex, "");
  modifiableInput = modifiableInput.split("");
  
  while (!exit) {
    var index = findReaction(modifiableInput);
    if (index !== -1) {
      modifiableInput.splice(index, 2);
    } else {
      exit = true;
    }
  }

  alphabet[alphabetLetter] = modifiableInput.join("").length;
});

console.log(alphabet);

